import {logo} from "./../images/logo.svg"
function Header() {
    return (
      <div className='root'>
      <header className="header">
        <img
          className="header__logo"
          src={logo}
          // src={require('./../images/logo.svg')}
        // src="<%=require('./../images/logo.svg')%>"
          alt="Логотип сервиса"
        />
      </header>
      </div>
  );
}

export default Header;
